class Solution {

    /**
     * @param String $word
     * @param Integer $k
     * @return Integer
     */
    function countCompleteSubstrings($word, $k) {
        $total = 0;
        for ($i = 0; $i < 26; $i++) {
            $count = array_fill(0, 26, 0);
            $unique = 0;
            for ($j = $i, $l = $i; $l < strlen($word); $l++) {
                if (++$count[ord($word[$l]) - ord('a')] == $k) {
                    $unique++;
                }
                while ($unique > 2 || $count[ord($word[$l]) - ord('a')] > $k) {
                    if ($count[ord($word[$j]) - ord('a')]-- == $k) {
                        $unique--;
                    }
                    $j++;
                }
                if ($unique == 2) {
                    $total += $j - $i + 1;
                }
            }
        }
        return $total;
    }
}
